import React from 'react';
import Homepage from './components/homepage';
import Investasipage from './components/investasipage';
import DetailPage from './components/detail'
import 'bootstrap/dist/css/bootstrap.min.css';
import './assets/style/style.css'
import { BrowserRouter , Route, Switch} from "react-router-dom";
import LoginPage from './components/loginpage'
import SignUp from './components/loginpage/register';

function App() {
  return (
  <BrowserRouter>
  <div>
    <Route exact path='/' component={Homepage} />
    <Switch>
    <Route  exact path='/investasi' component={Investasipage} />
    <Route  path='/investasi/:id' component={DetailPage} />
    </Switch>
    <Router  path='/login' component={LoginPage} />
    <Route  path='/register' component={SignUp} />

  </div>
  </BrowserRouter>
  );
}

export default App;
